import {
  Stack,
  AppBar,
  Toolbar,
  IconButton,
  MenuIcon
} from "@mui/material";
import DashboardIcon from '@mui/icons-material/Dashboard';
const Admin = ()=>{
  const design = (
    <>
      <Stack>
        <AppBar position="static">
         <Toolbar>
           <IconButton>
            <Dashboard />
           </IconButton>
           </Toolbar>
        </AppBar>
      </Stack>
    </>
  );
  return design;
}
export default Admin;
